const Colors = {
    white: "white",
    lightGrey: "#F4F4F4",
    mediumGrey: "#D6D6D6",
    darkGrey: "#656565",
    blackGrey: "#4C4C4C",
    background: "#fff",
    lightBlue: "#2b80ff",
    whiteBlue: "#bed9ff",
    green: "#03BE66",
    black: "black",
};

export default Colors;
